// Nav.js
import React from 'react';
import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <nav className="navbar bg-body-tertiary fixed-top">
      <div className="container-fluid">
        <img className="logo" src={`${process.env.PUBLIC_URL}/vivian-source/logo.jpeg`} alt="Logo" />
        <button className="navbar-toggler" type="button" data-bs-toggle="offcanvas" data-bs-target="#offcanvasNavbar" aria-controls="offcanvasNavbar" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="offcanvas offcanvas-end" tabIndex="-1" id="offcanvasNavbar" aria-labelledby="offcanvasNavbarLabel">
          <div className="offcanvas-header">
            <h5 className="offcanvas-title" id="offcanvasNavbarLabel">MENU</h5>
            <button type="button" className="btn-close" data-bs-dismiss="offcanvas" aria-label="Close"></button>
          </div>
          <div className="offcanvas-body">
            <ul className="navbar-nav justify-content-end flex-grow-1 pe-3">
              <li className="nav-item"><Link to="/">Trang Chủ</Link></li>
              <li className="nav-item"><Link to="/roomview">Xem Phòng</Link></li>
              <li className="nav-item"><Link to="/entertain">Giải Trí</Link></li>
              <li className="nav-item"><Link to="/activity">Sinh Hoạt</Link></li>
              <li className="nav-item"><Link to="/service">Dịch Vụ</Link></li>
              <li className="nav-item"><Link to="/contact">Liên Hệ</Link></li>
            </ul>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
